- input: "TEXT\x1CC00508739\x1C1\x1C\x1CF3XA\x1CThis amendment is filed in response
    to the Request for Additional Information from the FEC dated 1/3/13.  The correspondence
    raised concerns over several specific earmarked contributions which did not appear
    to be transferred to the intended recipients.  As part of a larger audit of all
    of our records for earmarked contributions collected last year, we have determined
    that the contributions in question were simply forwarded to the intended recipients
    in the form of the original check from each contributor.  Accordingly, we have
    amended Schedule A supporting Line 11(a)(i) to mark these contributions as Memo
    entries to signify that they were not deposited into our PAC account.  And a corresponding
    entry for each earmarked contribution now appears on Schedule B supporting Line
    23, also marked as Memo entries.  We trust that this amendment adequately responds
    to your request.\n"
